127', '6', 'A.6', 'Adapting to Change', 'Responds positively to change, showing willingness to learn new ways to accomplish work.', null, '1'), ('184', '38', '128', '7', 'A.7', 'Respect for Individuals', 'Fosters mutual respect and supports UMHS commitment to diversity. Promotes community building and diversity initiatives that help employees learn and respect each others differences.', null, '1'), ('185', '38', '129', '8', 'A.8', 'Safety', 'Contributes to a safe and secure environment for patients, visitors, faculty, and staff by following hand hygiene and other established procedures and protocols as appropriate by job function.', null, '1'), ('186', '38', '130', '9', 'A.9', 'Quality', 'Adopts practices to improve work processes, enhance customer satisfaction and ensure excellence in daily work.', null, '1'), ('187', '38', '131', '10', 'A.10', 'Efficiency', 'Accomplishes work in ways that maximize productivity and available resources while minimizing waste.', null, '1'), ('188', '38', '132', '11', 'A.11', 'Attendance.', '', null, '1'), ('189', '39', '133', '12', 'B.1', 'Work effectively with physicians and other health care professionals to provide patient-centered care.', '', null, '1'), ('190', '39', '134', '13', 'B.2', 'Demonstrate caring and respectful behaviors when interacting with patients and their families.', '', null, '1'), ('191', '39', '135', '14', 'B.3', 'Obtains a relevant & complete health and medical history and performs appropriate physical examination.', '', null, '1'), ('192', '39', '136', '15', 'B.4', 'Performs or orders appropriate preventive and/or diagnostic tests or procedures based on the patient\'\'s age and history.', '', null, '1'), ('193', '39', '137', '16', 'B.5', 'Competently performs invasive and non-invasive procedures as appropriate to role.', '', null, '1'), ('194', '39', '138', '17', 'B.6', 'Develop and carry out patient management plans', '', null, '1'), ('195', '39', '139', '18', 'B.7', 'Provide health care services and education aimed at preventing health problems or maintaining health', '', null, '1'), ('196', '40', '140', '19', 'C.1', 'Utilize critical thinking and clinical judgment in diagnostic process.', '', null, '1'), ('197', '40', '141', '20', 'C.2', 'Formulate appropriate differential diagnosis based on the history, physical examination, and diagnostic test results.', '', null, '1'), ('198', '40', '142', '21', 'C.3', 'Accurately interpret diagnostic tests.', '', null, '1'), ('199', '40', '143', '22', 'C.4', 'Select appropriate pharmacologic and non-pharmacologic interventions.', '', null, '1'), ('200', '40', '144', '23', 'C.5', 'Manage general medical and surgical conditions to include understanding the indications, contraindications, side effects, interactions, and adverse reactions of pharmacologic agents and other relevant treatment modalities', '', null, '1'), ('201', '40', '145', '24', 'C.6', 'PRACTICE-BASED LEARNING AND IMPROVEMENT', 'Practice-based learning and improvement includes the processes through which clinicians engage in critical analysis of their own practice experience, medical literature, and other information resources for the purpose of self-improvement. Physician assistants are expected to:', null, '1'), ('202', '40', '146', '25', 'C.7', 'Analyze their own clinical practice and perform practice-based improvement activities to improve their patient care practices.', '', null, '1'), ('203', '40', '147', '26', 'C.8', 'Locate, appraise, and integrate evidence from scientific studies related to their area of practice.', '', null, '1'), ('204', '40', '148', '27', 'C.9', 'Apply information technology to manage information, access online medical information, and support their own continuing education.', '', null, '1'), ('205', '40', '149', '28', 'C.10', 'Facilitate the learning of students and/or other health care professionals within UMHS.', '', null, '1'), ('206', '41', '150', '29', 'D.1', 'Communicate effectively with patients, families, and the public, as appropriate, across a broad range of socioeconomic and cultural backgrounds.', '', null, '1'), ('207', '41', '151', '30', 'D.2', 'Communicate effectively and build respectful relationships with physicians, other health professionals, and health related agencies.', '', null, '1'), ('208', '41', '152', '31', 'D.3', 'Work effectively as a member or leader of a health care team or other professional group.', '', null, '1'), ('209', '41', '153', '32', 'D.4', 'Maintain comprehensive, timely, and legible medical records.', '', null, '1'), ('210', '42', '154', '33', 'E.1', 'Understanding of legal and regulatory requirements, as well as the appropriate role of the physician assistant', '', null, '1'), ('211', '42', '155', '34', 'E.2', 'Professional relationships with physician supervisors and other health care providers', '', null, '1'), ('212', '42', '156', '35', 'E.3', 'Seek consultation with faculty, as appropriate, for concerns and issues outside practitioners scope of knowledge or skills.', '', null, '1'), ('213', '42', '157', '36', 'E.4', 'Commitment to excellence and on-going professional development.', '', null, '1'), ('214', '42', '158', '37', 'E.5', 'Compassion, integrity, and respect for others.', '', null, '1'), ('215', '42', '159', '38', 'E.6', 'Responsiveness to patient needs that supersedes self-interest.', '', null, '1'), ('216', '42', '160', '39', 'E.7', 'Respect for patient privacy and autonomy.', '', null, '1'), ('217', '42', '161', '40', 'E.8', 'Accountability to patients, supervising physicians, society and the PA profession.', '', null, '1'), ('218', '42', '162', '41', 'E.9', 'Sensitivity and responsiveness to patients\'\' culture, age, gender, and disabilities.', '', null, '1'), ('219', '42', '163', '42', 'E.10', 'Systems Based Practice', 'Physician assistants must demonstrate an awareness of and responsiveness to the larger context and system of health care, as well as the ability to call effectively on other resources in the system to provide optimal health care. PAs should work to improve the larger health care system of which their practices are a part. Physician assistants are expected to:', null, '1'), ('220', '42', '164', '43', 'E.11', 'Accurately identify the appropriate site of care for presenting conditions, including identifying emergent cases and those requiring referral or admission.', '', null, '1'), ('221', '42', '165', '44', 'E.12', 'Practice cost-effective health care and resource allocation that does not compromise quality of care.', '', null, '1'), ('222', '42', '166', '45', 'E.13', 'Advocate for quality patient care and assist patients in dealing with system complexities.', '', null, '1'), ('223', '42', '167', '46', 'E.14', 'Partner with supervising physicians, health care managers, and other health care providers to assess, coordinate, and improve the delivery of health care and patient outcomes.', '', null, '1'), ('224', '42', '168', '47', 'E.15', 'Accept responsibility for promoting a safe environment for patient care and recognizing and correcting systems-based factors that negatively impact patient care.', '', null, '1'), ('225', '42', '169', '48', 'E.16', 'Adhere to and actively participate in patient safety initiatives to improve quality of care and patient outcomes within his/her area of practice.', '', null, '1');
COMMIT;

-- ----------------------------
--  Table structure for `question_choice`
-- ----------------------------
DROP TABLE IF EXISTS `question_choice`;
CREATE TABLE `question_choice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question_type_id` int(11) NOT NULL,
  `sort_order` int(11) NOT NULL,
  `name` varchar(200) DEFAULT NULL,
  `value` varchar(500) DEFAULT NULL,
  `rubric` varchar(500) DEFAULT NULL,
  `icon_prefix` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `question_type_id_index` (`question_type_id`),
  CONSTRAINT `question_choice_ibfk_1` FOREIGN KEY (`question_type_id`) REFERENCES `question_type` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=813 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

