--  Records of `question_choice`
-- ----------------------------
BEGIN;
INSERT INTO `question_choice` VALUES ('158', '37', '0', '(not set)', '0', '(no value)', 'levelBg'), ('159', '37', '1', 'Advanced Beginner', '1', 'Performs assessment and identifies appropriate nursing diagnosis and/or patient care standard with assistance.\n', 'levelBg'), ('160', '37', '2', 'Fully Competent', '2', 'Independently and completely performs focused assessment to provide most effective patient care for a given patient population.\nRecognizes specialty data.\n', 'levelBg'), ('161', '37', '3', 'Proficient', '3', 'Independently and consistently performs goal- focused and individualized assessment when caring for all patients, including those with complex pathophysiological and psychosocial needs.\n', 'levelBg'), ('162', '37', '4', 'Expert', '4', 'Exhibits highly developed assessment abilities that exemplify a comprehensive understanding of the total patient/family situation.\n', 'levelBg'), ('163', '38', '0', '(not set)', '0', '(no value)', 'levelBg'), ('164', '38', '1', 'Advanced Beginner', '1', 'Recognizes data and identifies obvious nursing diagnoses.\n', 'levelBg'), ('165', '38', '2', 'Fully Competent', '2', 'Prioritizes key nursing diagnoses to address physical and psychosocial/ emotional areas.\n', 'levelBg'), ('166', '38', '3', 'Proficient', '3', 'Individualizes nursing diagnoses based on assessment data.\n', 'levelBg'), ('167', '38', '4', 'Expert', '4', 'Individualizes nursing diagnoses based on assessment data and integrates that with the diagnoses &amp; priorities of other disciplines in order to provide holistic care.\n', 'levelBg'), ('168', '39', '0', '(not set)', '0', '(no value)', 'levelBg'), ('169', '39', '1', 'Advanced Beginner', '1', 'Practice is guided primarily by policies, procedures, and standards.\nIdentifies expected outcomes and nursing interventions to meet identified diagnoses and maintain standards of clinical practice.\nEvaluates patients based on basic standards.\n', 'levelBg'), ('170', '39', '2', 'Fully Competent', '2', 'Practice is driven by theory and experience. Independently develops, implements, and evaluates plan of care that recognizes subtle changes in patients condition and adapts plan as needed.\n', 'levelBg'), ('171', '39', '3', 'Proficient', '3', 'Practice relies on previous experience for focused analysis of problems and solutions with individual patient modification in order to meet outcomes.\nAccommodates unplanned events and evaluates/ responds appropriately with speed, efficiency, flexibility and confidence.\n', 'levelBg'), ('172', '39', '4', 'Expert', '4', 'Practice is driven by an intuitive base and is self- directed, flexible, and innovative.\nIs consistently effective in providing holistic care that ensures positive change even in the most challenging patient care situations.\n', 'levelBg'), ('173', '40', '0', '(not set)', '0', '(no value)', 'levelBg'), ('174', '40', '1', 'Advanced Beginner', '1', 'Utilizes standard unit technology and with assistance uses advanced technology as appropriate. Utilizes computer correctly for basis functions, including:  Groupwise  CareWeb  labs and radiology results reporting  Omnicell  Mandatory Program/ Competencies  Policies and procedures\n', 'levelBg'), ('175', '40', '2', 'Fully Competent', '2', 'Utilizes standard unit technology and uses advanced technology as appropriate. Utilizes computer for basic functions as well as reference on patient conditions and treatment.\n', 'levelBg'), ('176', '40', '3', 'Proficient', '3', 'Becomes expert and resource for use of standard unit technology and advanced technology as appropriate.\nBecomes resource for use of computer.\n', 'levelBg'), ('177', '40', '4', 'Expert', '4', 'Takes a leadership role in evaluating technology and its potential for use.\nAble to conduct literature search through library functions  CINAHL, Cochrane, Medline, PubMed.\n', 'levelBg'), ('178', '41', '0', '(not set)', '0', '(no value)', 'levelBg'), ('179', '41', '1', 'Advanced Beginner', '1', 'Recognizes how the nurse- patient/family relationship impacts the patient experience. Introduces self as a Registered Nurse and describes role.\nConsistently wears identification. Establishes open communication.\n', 'levelBg'), ('180', '41', '2', 'Fully Competent', '2', 'Possesses clarity on ones own values and how they effect interactions, relationships and boundary setting.\nIndividualizes communication based on assessment of the patients and families.\n', 'levelBg'), ('181', '41', '3', 'Proficient', '3', 'Consistently role models individualized therapeutic communication based on patient and family needs. Initiates consultation/leader- ship with the healthcare team to share and promote collaborative approach to patient and family care.\n', 'levelBg'), ('182', '41', '4', 'Expert', '4', 'Intuitively uses expert therapeutic communication with patient/family.\nShares and promotes collaborative approach to patient and family care.\n', 'levelBg'), ('183', '42', '0', '(not set)', '0', '(no value)', 'levelBg'), ('184', '42', '1', 'Advanced Beginner', '1', 'Recognizes the need for patient and family to participate in care. Seeks help as appropriate to assess readiness for participation in care.\n', 'levelBg'), ('185', '42', '2', 'Fully Competent', '2', 'Incorporates patient/family in planning and implementing care.\n', 'levelBg'), ('186', '42', '3', 'Proficient', '3', 'Invites patients and families to actively participate in plan of care to foster growth and competence.\n', 'levelBg'), ('187', '42', '4', 'Expert', '4', 'Maximizes patient/family participation in decision making and goal setting along the continuum of care.\n', 'levelBg'), ('188', '43', '0', '(not set)', '0', '(no value)', 'levelBg'), ('189', '43', '1', 'Advanced Beginner', '1', 'Actively listens to patient/ family concerns in a respectful manner.\nShows kindness and caring with patients/families.\n', 'levelBg'), ('190', '43', '2', 'Fully Competent', '2', 'Demonstrates empathy in interactions with patient/ Families.\n', 'levelBg'), ('191', '43', '3', 'Proficient', '3', 'Plans and provides nursing care that promotes intentional caring.\n', 'levelBg'), ('192', '43', '4', 'Expert', '4', 'Intuitive understanding of patient/family experience and is proactive in providing creative approaches to optimize comfort and support.\n', 'levelBg'), ('193', '44', '0', '(not set)', '0', '(no value)', 'levelBg'), ('194', '44', '1', 'Advanced Beginner', '1', 'Recognizes, respects, and supports patient/family rights and maintains confidentiality.\nAware of UMHS patient rights and responsibility.\n', 'levelBg'), ('195', '44', '2', 'Fully Competent', '2', 'Mobilizes appropriate resources in response to situations that have the potential to negatively impact patient/family outcomes.\nRecognizes ethical issues and seeks assistance in addressing them.\n', 'levelBg'), ('196', '44', '3', 'Proficient', '3', 'Challenges situations and/or decisions that obstruct positive patient outcomes and works to reduce barriers. Anticipates patient/family needs.\n', 'levelBg'), ('197', '44', '4', 'Expert', '4', '***Challenges and adapts systems to maximize the benefits for patient care.\n', 'levelBg'), ('198', '45', '0', '(not set)', '0', '(no value)', 'levelBg'), ('199', '45', '1', 'Advanced Beginner', '1', 'Recognizes role of each member of the health care team.\nAware of importance of team collaboration and with guidance begins to initiate collaborative communication.\nInitiates referrals.\nRecognizes the impact of ones behavior on others.\n', 'levelBg'), ('200', '45', '2', 'Fully Competent', '2', 'Initiates, recognizes and values professional collaborative communication and the positive effect on patient outcomes. Identifies and utilizes collaborative resources.\nMonitors referrals.\n', 'levelBg'), ('201', '45', '3', 'Proficient', '3', 'Is sought out by members of the multi-disciplinary health care team.\nFrequently initiates consults with health care team.\nActively collaborates with other health professionals in delivering care.\nRecognizes need and calls for team conference.\nActs as resource to nursing and health care team.\n', 'levelBg'), ('202', '45', '4', 'Expert', '4', 'Through shared values and a clear professional identify, demonstrates and role models an interdisciplinary collaborative approach to patient care.\nParticipates and/or leads team care conference.\n', 'levelBg'), ('203', '46', '0', '(not set)', '0', '(no value)', 'levelBg'), ('204', '46', '1', 'Advanced Beginner', '1', 'Identifies self as member of nursing and health care teams. Begins to generate trust, respect, and compassion within the workgroup.\nTakes responsibility for developing beginning team relationships.\nSeeks assistance with resolving conflict. Meets professional commitments consistently.\nAsks for and accepts help when needed.\n', 'levelBg'), ('205', '46', '2', 'Fully Competent', '2', 'Functions as an independent and supportive team member. Provides assistance to others. Demonstrates empathy and compassion in interactions with team members.\nApproaches conflict situations in a constructive manner.\n', 'levelBg'), ('206', '46', '3', 'Proficient', '3', 'Fosters mutual regard, respect, and trust.\nDemonstrates flexibility.\nCreates conditions and relationships that promote creative, innovative, and positive processes and outcomes.\nRole models behaviors that demonstrate compassion and caring.\nFosters others development of conflict resolution skills.\nDemonstrates active engagement to enhance patient care and promote a positive workplace.\n', 'levelBg'), ('207', '46', '4', 'Expert', '4', 'Demonstrates team values that orient people to care about performance and success of others.\nRecognizes value of conflict in individual and organization learning and growth.\n', 'levelBg'), ('208', '47', '0', '(not set)', '0', '(no value)', 'levelBg'), ('209', '47', '1', 'Advanced Beginner', '1', 'Engages in self assessment related to orientation and ongoing learning needs and seeks out unit resources to assist in meeting needs.\nCompletes mandatory/ competency requirements during orientation and annually.\n', 'levelBg'), ('210', '47', '2', 'Fully Competent', '2', 'Sets goals for knowledge/ skill enhancement within the practice setting.\nSeeks out additional learning experiences within practice area:  Unit specific certifications  Consultation with experts  Inservices/rounds  Collaborates with multidisciplinary team\n', 'levelBg'), ('211', '47', '3', 'Proficient', '3', '***Sets goals for knowledge/skill enhancement within and beyond the practice setting.\n***Attends inservice(s)/CE within and beyond practice area.\n', 'levelBg'), ('212', '47', '4', 'Expert', '4', '***Sets goals in self directed manner and actively seeks out opportunities for knowledge/skill enhancement within and beyond the practice setting.\n***Evidence of advancing professional identify (at least one):  Certification in specialty (ACCN, ANCC Specialty Areas)  Active participation in Professional organization (i.e., clinical specialty organizations, UMPNC, MNA, ANA, UAN)  Active membership/ leadership role in institutional groups related to nursing\n', 'levelBg'), ('213', '48', '0', '(not set)', '0', '(no value)', 'levelBg'), ('214', '48', '1', 'Advanced Beginner', '1', 'Has knowledge of and supports established nursing improvement projects/endeavors in practice setting.\n', 'levelBg'), ('215', '48', '2', 'Fully Competent', '2', 'Identifies areas for creative improvement in practice setting and seeks out resources and avenues to address them (unit practice council, content experts, etc.).\n', 'levelBg'), ('216', '48', '3', 'Proficient', '3', 'Takes on leadership role in relation to innovations/ improvements in practice setting. Reads evidence based articles related to area of practice.\n', 'levelBg'), ('217', '48', '4', 'Expert', '4', 'Independently seeks out opportunities to share information and influence evidence based nursing practice.\nEvaluates effectiveness of innovation/practice challenges.\n', 'levelBg'), ('218', '49', '0', '(not set)', '0', '(no value)', 'levelBg'), ('219', '49', '1', 'Advanced Beginner', '1', 'Reads clinical articles. Participates in unit/area based Continuous Quality Improvement projects.\n', 'levelBg'), ('220', '49', '2', 'Fully Competent', '2', 'Demonstrates an awareness of current literature in area of practice, including journal club, inservices, etc.\nIdentifies individual patient problems which require investigation. Participates in unit/area based research, as appropriate.\n', 'levelBg'), ('221', '49', '3', 'Proficient', '3', '***Participates in unit/area based/institutional Continuous Quality Improvement projects.\nPresents at unit based educational forums.\n', 'levelBg'), ('222', '49', '4', 'Expert', '4', 'Implements change in practice for a population of patients based on the application of current research findings and evaluates effectiveness of practice changes.\nMakes recommendations for changes in practice based on findings. ***Shares findings of Continuous Quality Improvement projects, such as:  Unit presentation  Rounds  Poster  Publishing\nApplies current literature/ research to problems in practice area.\n', 'levelBg'), ('573', '122', '0', '(not set)', '0', '(no value)', 'levelBg'), ('574', '122', '1', 'Not Met', '1', 'The requirements are not met.', 'levelBg'), ('575', '122', '2', 'Approaching', '2', 'Progress is being made toward completion of the requirements.', 'levelBg'), ('576', '122', '3', 'Solid Performance', '3', 'Requirements have been met.', 'levelBg'), ('577', '122', '4', 'Exemplary', '4', 'Requirements have been met and exceeded.', 'levelBg'), ('578', '123', '0', '(not set)', '0', '(no value)', 'levelBg'), ('579', '123', '1', 'Not Met', '1', 'The requirements are not met.', 'levelBg'), ('580', '123', '2', 'Approaching', '2', 'Progress is being made toward completion of the requirements.', 'levelBg'), ('581', '123', '3', 'Solid Performance', '3', 'Requirements have been met.', 'levelBg'), ('582', '123', '4', 'Exemplary', 