INSERT INTO `question_group` VALUES ('24', '5', 'Clinical Skills and Knowledge', 'A', '1', '', null), ('25', '5', 'Therapeutic Relationships', 'B', '2', 'An intentional interactive relationship with patients and families that iscaring, clear, boundaried, positive and professional. It encompasses the philosophy of the institution, empowerment of the care givers and empowerment of the patient/family.', null), ('26', '5', 'Professional Relationships', 'C', '3', 'An intentional interactive relationship with the health care team thatis marked by mutual regard, trust, and active engagement.', null), ('27', '5', 'Professional Development', 'D', '4', 'Committed to the professional development of self and others.', null), ('28', '5', 'Advancing Practice through Innovation and Research', 'E', '5', 'Demonstrates ongoing innovation byreviewing, critiquing and applying existing evidence to practice. Continually improves practice by applying performance improvement methodologies.', null), ('38', '9', 'General', 'A', '1', 'UMHHC Performance Behaviors', null), ('39', '9', 'Patient Care', 'B', '2', 'Physician Assistants must be able to provide patient care that is compassionate, appropriate, and effective for the treatment of health problems and the promotion of health. Physician assistants are expected to:', null), ('40', '9', 'Medical Knowledge', 'C', '3', 'Medical knowledge includes an understanding of pathophysiology, patient presentation, differential diagnosis, patient management, surgical principles, health promotion, and disease prevention. Physician assistants must demonstrate core knowledge about established and evolving biomedical and clinical sciences and the application of this knowledge to patient care in their area of practice. Physician Assistants are expected to:', null), ('41', '9', 'Interpersonal and Communication Skills', 'D', '4', 'Interpersonal skills and communication skills encompass verbal, nonverbal and written exchange of information. Physician assistants must demonstrate interpersonal and communication skills that result in effective information exchange with patients and their families, physicians, and other health professionals. Physician assistants are expected to:', null), ('42', '9', 'Professionalism', 'E', '5', 'Professionalism is the expression of positive values and ideals as care is delivered. Physician assistants must know their limitations. Professionalism also requires that PAs practice without impairment from substance abuse, cognitive deficiency, or mental illness. Physician assistants must demonstrate a high level of responsibility, ethical practice, sensitivity to a diverse patient population and adherence to legal and regulatory requirements. Physician assistants are expected to demonstrate:', null);
COMMIT;

