INSERT INTO `resource` VALUES ('1', 'T', 'PM', 'NRS001', 'Introduction to Nursing', null, 'This module provides a general overview of nursing.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('2', 'T', 'PM', 'NRS002', 'Allergy Identification', null, 'Important characteristics of current and evolving advanced technician practice models\n            include training through an ASHP accredited training program, PTCB certification, and licensure with a Board of Pharmacy.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('3', 'T', 'PM', 'NRS003', 'Nursing Assessment', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('4', 'T', 'PM', 'NRS004', 'Nursing Diagnosis', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('5', 'T', 'PM', 'NRS005', 'Planning', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('6', 'T', 'PM', 'NRS006', 'Plan Evaluation', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('7', 'T', 'PM', 'NRS007', 'Nursing Technologies', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('8', 'T', 'PM', 'NRS008', 'Communication', null, 'This module provides a general overview.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('9', 'T', 'PM', 'NRS009', 'Patient Centered Care', null, 'Pharmacy Calculations: An Introduction for Pharmacy Technicians, is designed for pharmacy technician students enrolled in a training program, technicians preparing for the certification exam, and for on-site training. As the role for pharmacy technicians continues to evolve and expand one thing remains constant. The safety of patients is the highest priority for anyone working in pharmacy, whether in hospital, retail, or institutional practices. With a thorough understanding of pharmacy math comes accuracy in computations and safety and quality in practice.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('10', 'T', 'PM', 'NRS010', 'Ethics', null, 'Drug names can often sound similar or appear similar. In addition the appearance of the products can look similar enough to cause confusion. These can easily be confused contributing to adverse medication events.', null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('11', 'T', 'PM', 'NRS011', 'Advocacy', null, null, null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29'), ('12', 'T', 'PM', 'NRS012', 'Collaboration', null, null, null, null, '2015-10-26 15:53:29', '2015-10-26 15:53:29');
COMMIT;

